const About = () => {
    return (
        <div className="about-container">
            <h2 className="about-me-title">ABOUT ME</h2>
            <p className="about-me-text">My name is Molly Thompson and I am a 22 year old recent graduate of Web/UX Level 6 Dimploma. I completed my first  I.T Diploma at Weltec in 2021 and my second I.T Diploma at YooBee Design school. I have a huge passion for everything web, in particular JavaScript. Through my web design course we learnt a huge variety of skills and worked with many different libraries and packages. I am now ready to dive into my career in Front End Development. </p>
        </div>
    )
}

export default About
